import React, { Component } from "react";
import NavbarComponent from "./Components/NavbarComponent";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
 
class App extends Component {
  render() {
    return (
      <div>
        <NavbarComponent />
      </div>
    );
  }
}
 
export default App;
